import { Link } from "react-router-dom";
import "../Styles/navbar.css"


const Navbar = () => {
    return (
        <div className="navbar">
            <div className="book">
                {/* <img src="https://www.greenwichlibrary.org/wp-content/themes/greenwich-sage/assets/images/icons/main-logo-green.svg" alt="" /> */}
            </div>
            <div className="logo">
            <img src="https://www.greenwichlibrary.org/wp-content/themes/greenwich-sage/assets/images/icons/main-logo-green.svg" alt="" />
                <h1>Book Hub</h1>
            </div>
            <div className="links">
                <Link to="/adminPortal/" >Home</Link>
                <Link to="/adminPortal/books" >Books</Link>
                <Link to="/adminPortal/users" >Users</Link>
                <Link to="/adminPortal/addBooks" >Add Books</Link>
                <Link to="/adminPortal/addUsers" >Add Users</Link>
                <Link to="/adminLogin">Logout</Link>
            </div>
        </div>
      );
}
 
export default Navbar;
